import { resolvers } from './resolvers'
const typeDef = `
type Query {
    hello:String
    greet(name:String!): String
    task:[Task]
}

type Task {
    id: ID
    title:String!
    description:String!
    number:Int!
}

`

export default makeExecutableSchema({
    typeDefs:typeDef,
    resolvers:resolvers
})

